import numpy as np
def saveVLAWEForDocuments (labelsPath, vlawePath, labels, vlaweForDocuments):
	f=open(labelsPath,'w+')
	for i in range(len(labels)):
		f.write(str(labels[i]))
		if i != len(labels)-1:
			f.write(',')
	f.close()
	
	
	ff=open(vlawePath,'w+')
	for vlaweDocument in vlaweForDocuments:
		for vlawe in vlaweDocument:
			for i in range(len(vlawe)):
				ff.write(str(vlawe[i]))
				if i != len(vlawe)-1:
					ff.write(',')
			ff.write('\n')	
	ff.close()
	
	return
	
	
def loadVLAWEForDocuments(labelsPath, vlawePath, numberOfVLAWEWords):
	labels=np.genfromtxt(labelsPath, delimiter=',')
	
	
	vlaweForDocuments=[]
	f=open(vlawePath,'r+')
	count=0
	vlaweDocument=[]
	for line in f:
		count+=1
		vlaweDocument.append([float(l) for l in line.split(',')])
		if count==numberOfVLAWEWords:
			vlaweForDocuments.append(vlaweDocument)
			vlaweDocument=[]
			count=0
	f.close()

	
	
	return labels, np.array(vlaweForDocuments)
	
	
